import { StatusBar } from 'expo-status-bar';
import { StyleSheet, Text, View, Pressable } from 'react-native';


export default function Home({navigation}) {
  return (
    <View style={styles.container}>
      <Text style={{fontSize:40, color:'black', marginTop:200}}>Welcome To</Text>
      <Text style={{fontSize:40, color:'black'}}>My Todo App</Text>

      <StatusBar style="auto" />
      <Pressable onPress={()=> navigation.navigate('Todo')} style={{backgroundColor:'gray', width:200,height:80,marginTop:50,borderRadius:10}}>
        <Text style={{color:'white',fontSize:50,marginLeft:40}}>Start</Text>
      </Pressable>
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
   
  },

});
